/* ==UserStyle==
@name           FontOverride
@namespace      github.com/gasuketsu/stylus-config
@version        1.0.0
@description    Font override configuration
@author         gasuketsu
==/UserStyle== */
@font-face {
    font-family: "ＭＳ Ｐゴシック";
    src: local("更紗ゴシック J"), local("Noto Sans CJK JP"), local("MS PGothic");
}

@font-face {
    font-family: "MS PGothic";
    src: local("更紗ゴシック J"), local("Noto Sans CJK JP"), local("MS PGothic");
}

@font-face {
    font-family: "MS UIGothic";
    src: local("更紗ゴシック UI J"), local("Noto Sans CJK JP"), local("MS UIGothic");
}

@font-face {
    font-family: "ＭＳ ゴシック";
    src: local("SarasaTerm J"), local("Noto Sans Mono CJK JP"), local("MS Gothic");
}

@font-face {
    font-family: "MS Gothic";
    src: local("SarasaTerm J"), local("Noto Sans Mono CJK JP"), local("MS Gothic");
}

@font-face {
    font-family: "ＭＳ Ｐ明朝";
    src: local("Noto Serif CJK JP"), local("MS PMincho");
}

@font-face {
    font-family: "MS PMincho";
    src: local("Noto Serif CJK JP"), local("MS PMincho");
}

